import { Text, View } from "react-native";

export default function App() {
  return(
    <View style={{
      flex: 1,
      padding: 24,
      backgroundColor: '#131016'
    }}>
      <Text style={{
        color: '#FFF',
        fontSize: 24,
        fontWeight: 'bold',
      }}>
        Nome do evento
      </Text>
      <Text style={{
        color: '#6B6B6B'
      }}>
        Sexta, 4 de novembro de 2022
      </Text>
    </View>
  )
}
